CREATE TABLE FrameStrips (
    id INTEGER AUTO_INCREMENT,    charId CHAR(2),
    animation VARCHAR(32),
    frame INTEGER,
    hitbox BOOLEAN,
    iasa BOOLEAN,
    autocancel BOOLEAN,
    PRIMARY KEY (id),
    UNIQUE (charId, animation, frame),
    FOREIGN KEY (charId) REFERENCES Characters(id),
    FOREIGN KEY (animation) REFERENCES SharedAnimations(internalName)
);





